const ActionType = {
  UPDATE_USER: "UPDATE_USER",
  RESET_ZOOM_USER: "RESET_ZOOM_USER",
};

const ActionCreator = {
  updateUser: (payload) => ({
    type: ActionType.UPDATE_USER,
    payload,
  }),
  resetZoomUser: (payload) => ({
    type: ActionType.RESET_ZOOM_USER,
    payload,
  }),
  resetZoomUser: (payload) => ({
    type: ActionType.RESET_ZOOM_USER,
    payload,
  }),
};

export { ActionCreator, ActionType };
